import AboutOuter from "./AboutOuter.jsx"
import { Component } from "react"
export default class NavOuter extends Component {
    constructor(props){
        super(props);
        this.state = {
            display : this.props.display
        }
    }
    render(){
        return(
            <div className = "NavOuter" style = {this.state}>
                <div>
                    <button onClick = {() => console.log(this.props.display)}>Contact Us</button>
                </div>
                <div>
                    <div>
                        <p>HOME</p>
                        <hr/>
                    </div>
                    <div>
                        <p>ABOUT US</p>
                        <img src="/assets/arrowAbout.png" alt="this is an arrow"/>
                        <hr/>
                        <AboutOuter></AboutOuter>
                    </div>
                </div>
            </div>
        )
    }
}
